import Link from "next/link"

const Index = ()=>(
    <div>
        <ul>
            <li><Link href="/"><a>Ana Sayfa</a></Link></li>
            <li><Link href="/random"><a>Rastgele</a></Link></li>
            <li><Link href="/hafta"><a>Haftanın Kitabı</a></Link></li>
        </ul>
        <h1>Kitaplarınız için<br></br>bir yer.</h1>
        <p>Ratgele kitap sayfasına giderek rastgele bir kitaba bakabilir veya Haftanın kitabı sayfasına giderek haftanın kitabını görebilirsiniz.</p>
    </div>
);
export default Index;
